define({"topics":[{"title":"Set up <span class=\"ph\">Overlay<\/span> Port Groups","shortdesc":"<p class=\"shortdesc\">The default port groups work for some deployments. You may need to set up <span class=\"ph\">overlay<\/span> port groups if         your deployment requires it.<\/p>","href":"content\/topics\/cond_overlay_pg_top.html#cond_overlay_pg_set_up_overlay_port_groups","attributes":{"data-id":"cond_overlay_pg_set_up_overlay_port_groups"},"menu":{"hasChildren":false},"tocID":"cond_overlay_pg_set_up_overlay_port_groups-d8884e10874","next":"cond_overlay_pg_set_up_overlay_port_groups-d8884e10874"},{"title":"Set up an <span class=\"ph\">Underlay<\/span> Port Group","shortdesc":"<p class=\"shortdesc\">By default, an <span class=\"ph\">Airwall Gateway<\/span> has two port         groups. One <span class=\"ph\">underlay<\/span>         port group assigned to Port 1 and one <span class=\"ph\">overlay<\/span> port group         assigned to the remaining ports. On virtual and cloud <span class=\"ph\">Airwall Gateways<\/span>, you may be able         to add additional ports by creating new virtual network adapters on the hypervisor. Some         hardware models allow you to add new ports by inserting port expansion modules.<\/p>","href":"content\/topics\/deploy_pg_underlay.html","attributes":{"data-id":"deploy_og_underlay"},"menu":{"hasChildren":false},"tocID":"deploy_og_underlay-d8884e10935","topics":[]},{"title":"Replicate Port Settings","shortdesc":"<p class=\"shortdesc\">For minimal disruption and less room for error, you can replicate the port         configuration between two <span class=\"ph\">Airwall Gateways<\/span> when setting up         an <span class=\"ph\">Airwall Gateway<\/span> HA pairing,         or when replacing an <span class=\"ph\">Airwall Gateway<\/span>.<\/p>","href":"content\/topics\/port_replication.html","attributes":{"data-id":"port_replication"},"menu":{"hasChildren":false},"tocID":"port_replication-d8884e10972","topics":[]},{"title":"Configure an <span class=\"ph\">Underlay<\/span> Port Failover Group","shortdesc":"<p class=\"shortdesc\"\/>","href":"content\/topics\/port_failover_group.html","attributes":{"data-id":"port_failover_group"},"menu":{"hasChildren":false},"tocID":"port_failover_group-d8884e11003","next":"port_failover_group-d8884e11003"}]});